"    <ul>",
"     <li>",
"      Gelucast&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F235754\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Topical Skin Product",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F235748\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Protectant:",
"     </b>",
"     Topical: Apply externally as an occlusive boot",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F235749\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F235742\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Bandage: 3&rdquo; x 10 yards; 4&rdquo; x 10 yards",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F235734\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Yes",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F235743\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     As a protectant and to support varicosities and similar lesions of the lower limbs",
"    </p>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F235752\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     1% to 10%: Local: Irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F235745\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to zinc gelatin or to any component of the formulation",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13300237\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F6223732\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no known significant interactions.",
"    </p>",
